import React, { useState } from "react";
import "./App.css"

const App = () => {
  // let message = "Ola!"
  const [task, setTask] = useState([
    {
      id: '1',
      title: 'Estudar',
      completed: false
    },
    {
      id: 2,
      title: 'Corre',
      completed: true
    }
  ]);

  return (
    <>
      <div className="container"></div>
    </>
  );
};

export default App;
